Brooklyn, NY based Dirty Projectors are set to release Bitte Orca, their 5th full-length album and first for Domino on June 8th 2009. The album was recorded in Portland, OR and Brooklyn, NY in 2008 and will be available on CD, LP &amp; via digital download.

David Longstreth formed Dirty Projectors in 2002 and the group now consists of Angel Deradoorian, Amber Coffman, Brian Mcomber and David as principal members. Lead single Stillness Is The Move will precede the album on 18th May and will be available on 12&quot; and digital, with b-sides and a remix by Lucky Dragons.

